import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className='d-flex'>
      <div className="login-button d-flex">
        <Link to="/login">
          <button>Login</button>
        </Link>
      </div>
      </div>
    </header>
  );
};

export default Header;
